<!DOCTYPE html>
<html lang="portugues">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Login</title>
    <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.8/dist/css/bootstrap.min.css" rel="stylesheet" integrity="sha384-sRIl4kxILFvY47J16cr9ZwB07vP4J8+LH7qKQnuqkuIAvNWLzeN8tE5YBujZqJLB" crossorigin="anonymous">
    <link href="https://cdn.jsdelivr.net/npm/bootstrap-icons@1.11.3/font/bootstrap-icons.css" rel="stylesheet">
    <link rel="stylesheet" href="index.css">
</head>
<body>
    <main id="container">
        <form id="login_form">
            <div id="">
                <div class="cab">
                    <h1>Login</h1>
                   <i id="icon_mode" class="bi bi-moon-fill"></i>    
                </div>

                <div id="local_midea">
                    <a href="fb" class="tamanho">
                        <img src="imagens/fb.png" alt="facebook">
                    </a>
                    <a href="g" class="tamanho">
                        <img src="imagens/google.png" alt="google">
                    </a>
                    <a href="git" class="tamanho">
                        <img src="imagens/git.png" alt="github">
                    </a>
                </div>
            </div>    
            <div id="imputs">
                <div class="imput-box">
                    <label for="nome">
                        Nome
                        <div class="input-icons">
                            <i class="bi bi-person-fill"></i>
                            <input type="text" id="nome" name="nome">
                            
                        </div>
                    </label>
                </div>
                <div class="imput-box">
                    <label for="email">
                        E-mail
                        <div class="input-icons">
                            <i class="bi bi-envelope-at-fill"></i>
                            <input type="text" id="email" name="email">
                        </div>
                    </label>
                </div>
                <div class="imput-box">
                    <label for="senha">
                        Senha
                        <div class="input-icons">
                           <i class="bi bi-key"></i>
                           <input type="text" id="senha" name="senha"> 
                        </div>
                    </label>
                    <div id="senha_esquecida">
                        <a href="S">
                            Esqueceu a senha?
                        </a>
                    </div>
                </div>
            </div>
            <button type="submit" id="login">Login</button>
        </form>
    </main>
